Here's a sample Spark job in Java that calculates the hit rate for the onsite attributed data based on the top frequent queries:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.Function2;
import scala.Tuple2;

import java.io.Serializable;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator implements Serializable {
    private static final long CACHE_DURATION = 12 * 60 * 60 * 1000; // 12 hours in milliseconds

    public static void main(String[] args) {
        // Assuming you have the Spark context set up
        // JavaSparkContext sc = ...

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteAttributedData = sc.textFile("path/to/onsite_attributed_data");
        JavaRDD<String> topFrequentQueries = sc.textFile("path/to/top_frequent_queries");

        // Create a map to store the cached queries and their timestamps
        final Map<String, Long> cache = new HashMap<>();

        // Calculate the hit rate
        Tuple2<Long, Long> hitRateResult = onsiteAttributedData.map(new Function<String, Tuple2<String, Long>>() {
            @Override
            public Tuple2<String, Long> call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);
                return new Tuple2<>(query, timestamp);
            }
        }).filter(new Function<Tuple2<String, Long>, Boolean>() {
            @Override
            public Boolean call(Tuple2<String, Long> queryTimestamp) throws Exception {
                String query = queryTimestamp._1();
                return topFrequentQueries.collect().contains(query);
            }
        }).map(new Function<Tuple2<String, Long>, Tuple2<Boolean, Long>>() {
            @Override
            public Tuple2<Boolean, Long> call(Tuple2<String, Long> queryTimestamp) throws Exception {
                String query = queryTimestamp._1();
                long timestamp = queryTimestamp._2();
                boolean isHit = false;

                if (cache.containsKey(query)) {
                    long cachedTimestamp = cache.get(query);
                    if (timestamp - cachedTimestamp <= CACHE_DURATION) {
                        isHit = true;
                    }
                }

                if (!isHit) {
                    cache.put(query, timestamp);
                }

                return new Tuple2<>(isHit, 1L);
            }
        }).reduce(new Function2<Tuple2<Boolean, Long>, Tuple2<Boolean, Long>, Tuple2<Boolean, Long>>() {
            @Override
            public Tuple2<Boolean, Long> call(Tuple2<Boolean, Long> a, Tuple2<Boolean, Long> b) throws Exception {
                return new Tuple2<>(a._1() || b._1(), a._2() + b._2());
            }
        });

        long hitCount = hitRateResult._1() ? 1 : 0;
        long totalCount = hitRateResult._2();
        double hitRate = (double) hitCount / totalCount;

        System.out.println("Hit Rate: " + hitRate);
    }
}
```

